function create_levelSelect(){
	//**console.log('funct: create_levelSelect');				
	if(konami>-1) konami = 0;//resetting opportunity for konamicode if it hasn't been done yet
    //optional fadeBox (topmost):
    fadeBox = new createjs.Shape();
    fadeBox.graphics.beginFill("black").drawRect(0,0, html5game.width, html5game.height);
    fadeBox.cache(0,0, html5game.width, html5game.height);
	fadeBox.mask = gamemask;
	
	//bg img:
	levelSelect_bg = new createjs.Bitmap(image['levelselect_bg']);
	levelSelect.addChild(levelSelect_bg);
	
	levelSelect_bg.mask = gamemask;
	

	for (var i=0;i<7;i++){
		signposts[i] = new createjs.BitmapAnimation(spritesheet['levelselect_signpost']);
		signposts[i].regX = 121/2;
		signposts[i].regY = 185/2;
		signposts[i].gotoAndStop(0);
		signposts[i].x = signpostsX[i] + signposts[i].regX - 10;
		signposts[i].y = signpostsY[i] + signposts[i].regY - 5;

	    signposts[i].signage = new createjs.BitmapAnimation(spritesheet['hud_bunnies']);
	    signposts[i].signage.scaleX = signposts[i].signage.scaleY = 0.65;
	    signposts[i].signage.gotoAndStop(i);
	    signposts[i].signage.x = signposts[i].x - signposts[i].regX + 14;
	    signposts[i].signage.y = signposts[i].y - signposts[i].regY + 32;
	    signposts[i].signage.visible = false;

		signposts[i].hitbox = new createjs.Shape();
		signposts[i].hitbox.graphics.beginFill("white").drawRect((signposts[i].x - signposts[i].regX -23),(signposts[i].y - signposts[i].regY  - 16), 164, 212);
		signposts[i].hitbox.alpha = 0.01;
		signposts[i].hitbox.id = i;
		signposts[i].hitbox.visible = false;
		signposts[i].hitbox.onPress = lvlBox_pressed;

		//level statuses:
		signposts[i].GOTpumpkins = false;
		signposts[i].GOTbunnies = false;

		//status icons for pumpkin & bunny -- per level. show/hide these based on level beaten status
	    signposts[i].pumpkin = new createjs.Bitmap(image['levelselect_pumpkins']);
	    signposts[i].pumpkin.x = signposts[i].x - signposts[i].regX - 80;
	    signposts[i].pumpkin.y = signposts[i].y - signposts[i].regY + 115;
	    signposts[i].pumpkin.visible = false;

        //signposts[i].bunny = new createjs.BitmapAnimation(spritesheet['bunnies']);
        //signposts[i].bunny.gotoAndStop("idle" + i.toString() );
        signposts[i].bunny = new createjs.BitmapAnimation(spritesheet['levelselect_bunnies']);
        signposts[i].bunny.gotoAndStop(i);
        signposts[i].bunny.x = signposts[i].x - signposts[i].regX + 74;
        signposts[i].bunny.y = signposts[i].y - signposts[i].regY + 64;
        signposts[i].bunny.visible = false;

		levelSelect.addChild(signposts[i]);
		levelSelect.addChild(signposts[i].signage);
		levelSelect.addChild(signposts[i].pumpkin);
		levelSelect.addChild(signposts[i].bunny);		
		levelSelect.addChild(signposts[i].hitbox);

		//play patch/level's name onMouseOver, but use lvlname_playing to prevent repeated play of currently playing name
		signposts[i].hitbox.onMouseOver = function(e){
			document.body.style.cursor='pointer';
			if(song_playing) return;
			if(lvlname_playing==e.target.id) return;

			stopSound();
			clearTimeout(sndto);
			lvlname_playing = e.target.id;
			
			sndto=setTimeout(function(){
				playSound( ('patch'+e.target.id.toString()), lvlname_done);
			}, 600);
		}
		signposts[i].hitbox.onMouseOut = function(e){
			document.body.style.cursor='default';
		}

	}
	
	//*********
	
	reward_bunnies = new createjs.Bitmap(image['reward_bunnies']);
	reward_nobunnies = new createjs.Bitmap(image['reward_nobunnies']);

	//stage.addChild(levelSelect);
	stage.addChild(fadeBox);
	stage.addChild(canvasblueborder);

	fadeBox.alpha = 0;	
	stage.update();
		
    createjs.Tween.get(fadeBox, {loop:false})
     .to({alpha:1}, 1000, createjs.Ease.none)
     .call(function(){     	     	
     	document.getElementById('coverImg').style.display = 'none';
     	stage.removeChild(fadeBox);
     	load_level0();
     });     

}

function load_level0(){
	
	lvl = 0;
	firstplay = true;
    mapData = levels[lvl];
 	createjs.Ticker.removeListener(levelSelect_tick);
	//allow level0's signpost / hitbox on lvlselect
	signposts[lvl].gotoAndStop(1);
	signposts[lvl].signage.visible = true;
	signposts[lvl].hitbox.visible = true;
	
	//load up the level: 	
 	initLayers();
}

function lvlname_done(){
	clearTimeout(sndto);
	lvlname_playing = -1;
}

function bringup_levelSelect(){
	
	if(konami>-1) konami = 0;//resetting opportunity for konamicode if it hasn't been done yet 

 	//if final level is beaten, play boosong, else: levelselect instructions
	if(signposts[signposts.length-1].GOTpumpkins){		
		
		if(!first_completion){
			song_playing = true; //prevent interruption of boosong
			//first_completion = true;  //uncomment this line to set first_completion to true so full song plays only on first beating of game
			playSound('boosong', playThankYou); //play boosong followed by thank you & instruction
		}
		else{
			playSound('boosong'); //play JUST boosong and allow interruption
		}
	}
	else playSound('pickpatch');
	
    
    //optional fadeBox (topmost):
    fadeBox = new createjs.Shape();
    fadeBox.graphics.beginFill("black").drawRect(0,0, html5game.width, html5game.height);
    fadeBox.cache(0,0, html5game.width, html5game.height);
    fadeBox.mask = gamemask;

    //different img/shape and status icons for level state (unbeaten, beaten 0, beaten 1)	
	for(var i=0;i<signposts.length;i++){
		if(signposts[i].GOTpumpkins){
			highest_completed = i;
			signposts[i].pumpkin.visible = true;
			signposts[i].gotoAndStop(1);			
		}
		
		if(signposts[i].GOTbunnies) signposts[i].bunny.visible = true;
	}

	//unlocking & highlighting next unplayed level after highest completed, unless level just played was last lvl, or level 0 not beaten
	if ( (lvl < levels.length-1) && (highest_completed<levels.length-1) && (signposts[0].GOTpumpkins) ) {
		signposts[highest_completed+1].alpha=0;
		signposts[highest_completed+1].signage.alpha=0;
	}

    createjs.Ticker.setFPS(60);
    createjs.Ticker.addListener(levelSelect_tick);

	stage.addChild(levelSelect);
	stage.addChild(fadeBox);
	stage.addChild(canvasblueborder);
    // fade away of fadeBox before calling endLevel

    createjs.Tween.get(fadeBox, {loop:false})
     .to({alpha:0}, 500, createjs.Ease.none)
     .call(function(){

     	fadein_next_level();
		//re-adding click listener for loading level
		for(var i=0;i<signposts.length;i++){
			signposts[i].hitbox.onPress = lvlBox_pressed;
		}

		if(konami==-1) execute_konamicode();
     });
}

function fadein_next_level(){
	//unlocking & highlighting next unplayed level after highest completed, unless level just played was last lvl, or level 0 not beaten
	if ( (lvl < levels.length-1) && (highest_completed<levels.length-1) && (signposts[0].GOTpumpkins) ) {
		signposts[highest_completed+1].signage.visible = true;		
		signposts[highest_completed+1].gotoAndStop(2);
	
		//do pulse:
	    createjs.Tween.get(signposts[highest_completed+1], {loop:false})
	     .wait(300)
	     .to({alpha:0.5, scaleX:1.3, scaleY:1.3}, 500, createjs.Ease.none)
	     .to({alpha:1.0, scaleX:1.0, scaleY:1.0}, 500, createjs.Ease.none)
	     .wait(200)
	     .call(function(){

		    createjs.Tween.get(signposts[highest_completed+1].signage, {loop:false})
		     .to({alpha:1.0}, 500, createjs.Ease.none)
		     .call(function(){
				    //enabling click to open level by making hitbox visible
				    //ALWAYS allow first levels hitbox to be visible
				    signposts[0].hitbox.visible = true;
					
					for(var i=0;i<signposts.length;i++){
						if(signposts[i].GOTpumpkins) signposts[i].hitbox.visible = true;
					}
					//allow access to next level after beaten
					signposts[highest_completed+1].signage.visible = true;
					signposts[highest_completed+1].hitbox.visible = true;

		     });

	     });
	}
	else{
	    //enabling click to open level by making hitbox visible
	    //ALWAYS allow first levels hitbox to be visible
	    signposts[0].hitbox.visible = true;
		
		for(var i=0;i<signposts.length;i++){
			if(signposts[i].GOTpumpkins) signposts[i].hitbox.visible = true;
		}

	}
}

function playThankYou(){
	stopSound();
	clearTimeout(sndto);
	
	//**console.log('playThankYou');

	sndto=setTimeout(function(){
		playSound('thanksforhelping', songDone);
	}, 200);
}
function songDone(){
	clearTimeout(sndto);
	playSound('pickpatch', play_first_completion_instruct);
}
function play_first_completion_instruct(){
	song_playing = false; //allow mouse over audio for sign posts
}
function lvlBox_pressed(e){
	//**console.log('pressed: ' + e.target.id)
	
	stopSound();
	clearTimeout(sndto);

	//removing click listener for loading level
	for(var i=0;i<signposts.length;i++){
		signposts[i].hitbox.visible = false;
		signposts[i].hitbox.onPress = null;
	}
	
	lvl = e.target.id;
    mapData = levels[lvl];


    var r = randomInt(1,2);
    //**console.log("R: " + r);
	playGeorge(r);

	setTimeout(switchToLevel(), 1000);
}

function switchToLevel(){

    //optional fade away of fadeBox before calling endLevel
    createjs.Tween.get(fadeBox, {loop:false})
     .to({alpha:1}, 1000, createjs.Ease.none)
     .call(function(){     	
     	createjs.Ticker.removeListener(levelSelect_tick);
     	stage.removeChild(levelSelect);
     	initLayers();
     });
}

function levelSelect_tick(){
	stage.update();
}

